package db.domain;import java.util.Arrays;public class MissionMapImpl implements MissionMap {	@Key	private String ids;	@Key	private int templetId;	private boolean isFinish;	private String args;	private int type;	private int paths;	private int indexs;	public MissionMapImpl() {	}	public MissionMapImpl(MissionMap c) {		this.ids = c.getIds();		this.templetId = c.getTempletId();		this.isFinish = c.getIsFinish();		this.args = c.getArgs();		this.type = c.getType();		this.paths = c.getPaths();		this.indexs = c.getIndexs();	}	@Override	public String tableName() {		return "mission_map";	}	public void setIds(String ids) {		this.ids = ids;	}	public String getIds() {		return this.ids;	}public void addIds(String ids) {		this.ids += ids;}	public void setTempletId(int templetId) {		this.templetId = templetId;	}	public int getTempletId() {		return this.templetId;	}public void addTempletId(int templetId) {		this.templetId += templetId;}	public void setIsFinish(boolean isFinish) {		this.isFinish = isFinish;	}	public boolean getIsFinish() {		return this.isFinish;	}	public void setArgs(String args) {		this.args = args;	}	public String getArgs() {		return this.args;	}public void addArgs(String args) {		this.args += args;}	public void setType(int type) {		this.type = type;	}	public int getType() {		return this.type;	}public void addType(int type) {		this.type += type;}	public void setPaths(int paths) {		this.paths = paths;	}	public int getPaths() {		return this.paths;	}public void addPaths(int paths) {		this.paths += paths;}	public void setIndexs(int indexs) {		this.indexs = indexs;	}	public int getIndexs() {		return this.indexs;	}public void addIndexs(int indexs) {		this.indexs += indexs;}}